import React from 'react';
import './Signup.css';
import ReactDOM from 'react-dom';


const SignIn = (props) => {
    return (
            <div> 
               <div className="signup">
                   <p className="text">Enter Email Add. :</p>
                   <input className="inputbox" type="email" onChange={props.email} />
               </div>
               <div className="signup">
                   <p className="text">Enter Password :</p>
                   <input className="inputbox" type="password"onChange={props.password} />
               </div><br/>
            <button type="submit" onClick={props.verify}>Submit</button>
           </div>
    );
}

ReactDOM.render( <React.StrictMode><SignIn verify={this.verificationSignIn} email={this.inputsigninemail}  password={this.inputsigninpassword} /></React.StrictMode>,document.getElementById('root'));
